import { useState } from "react"
import { useNavigate } from "react-router-dom";

const Org = ()=>{
    const [orgName, orgNameUpdate] = useState('');
    const [orgType, orgTypeUpdate] = useState('');

    const navigate = useNavigate();

    const orgEntry=async(e)=>{
        const inputObj = {'orgName':orgName, 'orgType':orgType}
        const fetchApi = await fetch('http://localhost:1731/org/createOrg',{
            method:'POST',
            headers:{'content-type':'application/json'},
            body:JSON.stringify(inputObj)
        });
        if(fetchApi.status === 200){
            navigate('/dashboard');
        }
    }
    return(
        <div>
            <form onSubmit={orgEntry}>
                <input type="text" value={orgName} onChange={(e)=>orgNameUpdate(e.target.value)}></input>
                <input type="text" value={orgType} onChange={(e)=>orgTypeUpdate(e.target.value)}></input>
                <input type="submit">ok</input>
            </form>
        </div>
    );
}

export default Org;
